import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import BasicSelect from './selector';
import EducationSelector from './education';
import EnglishSelector from './english';
import ExperientSelector from './experient';
import LanguageSelector from './language';
import SexSelector from './sex';
import SkillSelector from './skill';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

export default function BasicGrid() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
        <Grid item xs={3}>
          Education
          <EducationSelector/>
        </Grid>
        <Grid item xs={3}>
          English
          <EnglishSelector/>
        </Grid>
        <Grid item xs={3}>
          Experient
          <ExperientSelector/>
        </Grid>
        <Grid item xs={3}>
          Sex
          <SexSelector/>
        </Grid>
        <Grid item xs={4}>
          Language
          <LanguageSelector/>
        </Grid>
        <Grid item xs={4}>
          Skill
          <SkillSelector/>
        </Grid>
      </Grid>
    </Box>
  );
}
